import React from "react";
// import MyTodoList from "./component/MyTodoList";
import "./App.css";
function App() {
  const App = () => {
    const TodoLists = [
      {
        id: 1,
        title: "Java Script 공부하기",
        body: "chapter7 공부하기",
        isDone: false,
      },
      {
        id: 2,
        title: "운동하기",
        body: "9시부터 10시까지 빡시게 운동",
        isDone: false,
      },
      {
        id: 3,
        title: "세탁기돌리기",
        body: "수건빨래",
        isDone: false,
      },
    ];
    return <div></div>;
  };

  ["JS공부하기", "운동하기", "빨래하기"];
  return (
    <div className="app-style">
      {TodoLists.map((TodoListTitle) => {
        return (
          <div className="square-style" key={TodoListTitle}>
            {" "}
            {TodoListTitle}{" "}
          </div>
        );
      })}
    </div>
  );
}

export default App;
